import React from 'react';
import styled from 'styled-components';

const ButtonWrapper = styled.button`
border: none;
outline: none;
color: #fff;
padding: 10px 2em;
font-size: 18px;
font-weight: 250;
border-radius:3px;
background-color:#2a9d8f;

&:focus {
    outline: none;

}
`;

export default function Button(props) {
    return (
        <ButtonWrapper>(props.children)</ButtonWrapper>

    );
}
